import React from 'react'
import "./style.css";
export function Card({
    onClick, url
}) {
    return (

        <div className="col l3" >
            <div className="card">
                <div className="card-image">
                    <img className="img-size" onClick={props.onClick} src={props.url} alt="gif of Lebron"  isclicked={props.isClicked}/>
                </div>
            </div>
        </div>
    )

}

export default Card
